import React, { Component } from "react";
import { withStyles, Modal, TextField, Grid, Button } from "@material-ui/core";
import styles from "./styles";
class TaskForm extends Component {
  render() {
    const { onClose, onOpenForm, classes } = this.props;
    return (
      <Modal open={onOpenForm} onClose={onClose}>
        <div className={classes.modal}>
          <form>
            <Grid container>
              <Grid item md={12}>
                <TextField
                  id="title"
                  label="Tiêu đề"
                  className={classes.textField}
                  margin="normal"
                />
              </Grid>
              <Grid item md={12}>
                <TextField
                  id="description"
                  label="Mô tả"
                  className={classes.textField}
                  margin="normal"
                />
              </Grid>
              <Grid item md={12}>
                <Button variant="contained" onClick={onClose} color="default">
                  Huỷ bỏ
                </Button>
                <Button variant="contained" color="primary">
                  Lưu lại
                </Button>
              </Grid>
            </Grid>
          </form>
        </div>
      </Modal>
    );
  }
}

export default withStyles(styles)(TaskForm);
